import { loremIpsum } from "lorem-ipsum";

const Page = ({number}) => {


    return(
        <>
            <h2>Page {number}</h2>
            <section>
                <h4>Page content:</h4>
                <article>
                    {
                        loremIpsum({
                            count: 100,                // Number of "words", "sentences", or "paragraphs"
                            paragraphLowerBound: 3,  // Min. number of sentences per paragraph.
                            paragraphUpperBound: 5,  // Max. number of sentences per paragarph.
                            random: Math.random,     // A PRNG function
                            sentenceLowerBound: 5,   // Min. number of words per sentence.
                            sentenceUpperBound: 8,  // Max. number of words per sentence.
                            units: "paragraph",      // paragraph(s), "sentence(s)", or "word(s)"
                        })}
                </article>
            </section>
        </>
    );
};

export const PageOne = () => Page(1);
export const PageTwo = () => Page(2);
export const PageThree = () => Page(3);
export const PageFour = () => Page(4);
